import React from 'react';
import HtmlLogo from '../Assets/html.svg';
import CssLogo from '../Assets/css.svg';
import BsLogo from '../Assets/bootstrap.svg';
import jLogo from '../Assets/jquery.svg';
import JsLogo from '../Assets/javascript.svg';
import ReactLogo from '../Assets/react.svg';

class Stack extends React.Component {
  constructor(props){
    super(props)
  }

  render() {
    return (
      <div className="w-100 py-5" style={{backgroundColor:'#CAF0F8'}}>
        <h1>I've Got Some Skills</h1>
        <div className="d-flex flex-row flex-wrap w-100 px-md-5" >
            <div className="my-3 my-md-4" style={{maxWidth: 100}}>
                <img src={HtmlLogo} className="w-100"/>
                <p>HTML</p>
            </div>
            <div className="my-3 my-md-4" style={{maxWidth: '25%'}}>
                <img src={CssLogo} className="w-100"/>
                <p>CSS</p>
            </div>
            <div className="my-3 my-md-4" style={{maxWidth: '25%'}}>
                <img src={JsLogo} className="w-100"/>
                <p>JavaScript</p>
            </div>
            <div className="my-3 my-md-4" style={{maxWidth: '25%'}}>
                 <img src={BsLogo} />
                 <p>Bootstrap</p>
            </div>
            <div className="my-3 my-md-4" style={{maxWidth: '25%'}}>
                <img src={jLogo} />
                <p>jQuery</p>
            </div>
            <div className="my-3 my-md-4" style={{maxWidth: '25%'}}>
                 <img src={ReactLogo} />
                 <p>React.js</p>
            </div>
        </div>
      </div>
    );
  }
}

export { Stack }
